class TaskA {
    public void solve(int testNumber, InputReader in, PrintWriter out) {
        long t1 = in.nextLong();
        long t2 = in.nextLong();
        long X1 = in.nextLong();
        long X2 = in.nextLong();
        long t0 = in.nextLong();

        if (t1 == t2) {
            out.println(X1 + " " + X2);
            return;
        } else if (t1 == t0) {
            out.println(X1 + " " + 0);
            return;
        } else if (t2 == t0) {
            out.println(0 + " " + X2);
            return;
        }

        double cur = 1e100;
        long optXA = 0, optXB = 0;

        for (long xa = X1; xa >= 0; --xa) {
            long xb = getXB(t1, t2, t0, xa) - 3;

            for (int delta = -3; delta <= 3; ++delta, ++xb) {
                if (xa + xb <= 0) continue;
                if (xb <= X2 && xb >= 0) {
                    double T = getSpeed(t1, t2, xa, xb);
                    if (DoubleUtils.compareTo(T, t0) >= 0) {
                        if (DoubleUtils.compareTo(cur, T) > 0 || DoubleUtils.compareTo(cur, T) == 0 && optXA + optXB < xa + xb) {
                            cur = T;
                            optXA = xa;
                            optXB = xb;
                        }
                    }
                }
            }
        }
        out.println(optXA + " " + optXB);
    }

    private double getSpeed(long t1, long t2, long xa, long xb) {
        double up = t1 * xa + t2 * xb;
        double down = xa + xb;
        return up / down;
    }

    private long getXB(long t1, long t2, long t0, long xa) {
        long up = (t0 - t1) * xa;
        long down = (t2 - t0);
        return up / down;
    }
}

