    static class TaskC {
        Fraction max = Fraction.MAX_VALUE;
        long t0;
        long t1;
        long t2;
        long ansY1 = 0;
        long ansY2 = 0;

        public void solve(int testNumber, QuickScanner in, PrintWriter out) {
            t1 = in.nextLong();
            t2 = in.nextLong();
            int x1 = in.nextInt();
            int x2 = in.nextInt();
            t0 = in.nextLong();
            update(x1, x2);
            update(0, x2);
            update(x1, 0);
            for (int y1 = 0; y1 <= x1; ++y1) {
                if (t0 == t2) {
                    update(0, x2);
                } else {
                    Fraction cur = Fraction.as(y1 * t1 - t0 * y1, t0 - t2);
                    long floor = cur.floor();
                    long ceil = cur.ceil();
                    if (floor <= x2 && floor >= 0) update(y1, floor);
                    if (ceil <= x2 && ceil >= 0) update(y1, ceil);
                }
            }
            out.println(ansY1 + " " + ansY2);
        }

        boolean update(long y1, long y2) {
            if (y1 + y2 == 0) return false;
            Fraction current = Fraction.as(y1 * t1 + y2 * t2, y1 + y2);
            Fraction sub = current.substract(Fraction.as(t0));
            if (sub.isNegative()) {
                return false;
            }
            if (sub.compareTo(max) < 0 || (sub.compareTo(max) == 0 && y1 + y2 > ansY1 + ansY2)) {
                max = sub;
                ansY1 = y1;
                ansY2 = y2;
                return true;
            }
            return true;
        }

    }

    static class IntegerUtils {
        public static long gcd(long a, long b) {
            return (b == 0) ? a : gcd(b, a % b);
        }

        public static long lcm(long a, long b) {
            return (a * b) / gcd(a, b);
        }

    }

    static class QuickScanner {
        BufferedReader br;
        StringTokenizer st;
        InputStream is;

        public QuickScanner(InputStream stream) {
            is = stream;
            br = new BufferedReader(new InputStreamReader(stream), 32768);
        }

        public String nextToken() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    throw new RuntimeException(e);
                }
            }
            return st.nextToken();
        }

        public int nextInt() {
            return Integer.parseInt(nextToken());
        }

        public long nextLong() {
            return Long.parseLong(nextToken());
        }

    }

    static class Fraction implements Comparable<Fraction> {
        public static Fraction ZERO = new Fraction(0, 1);
        public static Fraction MAX_VALUE = new Fraction(Long.MAX_VALUE);
        long numerator;
        long denominator;

        public Fraction(long number) {
            this(number, 1);
        }

        public Fraction(long numerator, long denominator) {
            this.numerator = numerator;
            this.denominator = denominator;
        }

        public long getNumerator() {
            return numerator;
        }

        public long getDenominator() {
            return denominator;
        }

        public Fraction reduce() {
            long gcd = IntegerUtils.gcd(getNumerator(), getDenominator());
            if (gcd == 1) {
                return this;
            }
            return new Fraction(getNumerator() / gcd, getDenominator() / gcd);
        }

        public Fraction add(Fraction other) {
            long lcm = IntegerUtils.lcm(getDenominator(), other.getDenominator());
            long numerator = getNumerator() * (lcm / getDenominator());
            numerator += other.getNumerator() * (lcm / other.getDenominator());
            return new Fraction(numerator, lcm).fix().reduce();
        }

        public Fraction fix() {
            if (getDenominator() < 0) {
                denominator *= -1;
                numerator *= -1;
            }
            return this;
        }

        public Fraction substract(Fraction other) {
            return this.add(other.negate());
        }

        public Fraction negate() {
            return new Fraction(-getNumerator(), getDenominator());
        }


        public String toString() {
            Fraction reduced = this.reduce();
            return reduced.getDenominator() != 1 ? String.format("%d/%d", reduced.getNumerator(), reduced.getDenominator()) : String.valueOf(getNumerator());
        }

        public static Fraction as(long numerator, long denominator) {
            return new Fraction(numerator, denominator);
        }

        public static Fraction as(long numerator) {
            return new Fraction(numerator);
        }


        public int compareTo(Fraction o) {
            long lcm = IntegerUtils.lcm(denominator, o.denominator);
            return Long.valueOf(numerator * lcm / denominator).compareTo(o.numerator * lcm / o.denominator);
        }

        public long floor() {
            this.fix();
            if (numerator >= 0) {
                return numerator / denominator;
            } else {
                return (numerator - denominator + 1) / denominator;
            }
        }

        public long ceil() {
            this.fix();
            if (numerator >= 0) {
                return (numerator + denominator - 1) / denominator;
            } else {
                return numerator / denominator;
            }
        }

        public boolean isPositive() {
            return getDenominator() * getNumerator() > 0;
        }

        public boolean isNegative() {
            return !isPositive() && this.compareTo(ZERO) != 0;
        }

    }
}

