      w.push_back(make_pair(t1 - t0, make_pair(-x1, make_pair(x1, 0))));
    for (long long i = 0; i <= x1; i++) {
      long long d = result(i, 1);
      if (d >= 0) w.push_back(make_pair(d, make_pair(-i - 1, make_pair(i, 1))));
