      while (high - low > 1) {
        mid = (low + high) / 2;
        if (check(i, mid))
          high = mid;
        else
          low = mid;
      }
      long long k = result(i, mid), u = result(i, high);
      if (k >= 0)
        v.push_back(make_pair(k, make_pair(-i - mid, make_pair(i, mid))));
