class TaskA {
    public void solve(int testNumber, InputReader in, OutputWriter out){
	    long t1 = in.ri(), t2 = in.ri(), x1 = in.ri(), x2 = in.ri(), t0 = in.ri();
	    if (t1 == t2){
		    out.printLine(x1, x2);
		    return;
	    }
	    double ans = Double.MAX_VALUE;
	    long a = 0, b = 0;
	    for(long y1 = 0; y1 <= x1; y1++) {
		    long min = y1 == 0 ? 1 : 0, max = x2;
		    while(min < max){
			    long avg = (min + max) / 2;
			    if(works(y1, avg, t1, t2, t0)) max = avg;
			    else min = avg + 1;
		    }
		    if(y1 == 0) min = x2;
		    if(works(y1, min, t1, t2, t0)){
			    double newdiff = (double) (t1 * y1 + t2 * min) / (y1 + min) - t0;
			    if(newdiff <= ans){
				    ans = newdiff;
				    a = y1;
				    b = min;
			    }
		    }
	    }
	    out.printLine(a, b);
    }
	boolean works(long y1, long y2, long t1, long t2, long t0){
		return (t1 * y1 + t2 * y2) >= t0 * (y1 + y2);
	}
}

class InputReader {
	private InputStream stream;
	private byte[] buf = new byte[1024];
	private int curChar;
	private int numChars;
	private SpaceCharFilter filter;

	public InputReader(InputStream stream) {
		this.stream = stream;
	}

	public int read() {
		if (numChars == -1)
			throw new InputMismatchException();
		if (curChar >= numChars) {
			curChar = 0;
			try {
				numChars = stream.read(buf);
			} catch (IOException e) {
				throw new InputMismatchException();
			}
			if (numChars <= 0)
				return -1;
		}
		return buf[curChar++];
	}
	public int ri(){
		return readInt();
	}

	public int readInt() {
		int c = read();
		while (isSpaceChar(c))
			c = read();
		int sgn = 1;
		if (c == '-') {
			sgn = -1;
			c = read();
		}
		int res = 0;
		do {
			if (c < '0' || c > '9')
				throw new InputMismatchException();
			res *= 10;
			res += c - '0';
			c = read();
		} while (!isSpaceChar(c));
		return res * sgn;
	}
	public boolean isSpaceChar(int c) {
		if (filter != null)
			return filter.isSpaceChar(c);
		return isWhitespace(c);
	}

	public static boolean isWhitespace(int c) {
		return c == ' ' || c == '\n' || c == '\r' || c == '\t' || c == -1;
	}
	public interface SpaceCharFilter {
		public boolean isSpaceChar(int ch);
	}
}

