public class C {

	private void work() throws IOException {
		Scanner sc = new Scanner(new BufferedReader(new InputStreamReader(
				System.in)));
		while (sc.hasNextInt()) {
			long t1 = sc.nextInt();
			long t2 = sc.nextInt();
			long x1 = sc.nextInt();
			long x2 = sc.nextInt();
			long t0 = sc.nextInt();

			if (t1 == t0) {
				if (t1 == t2)
					System.out.println(x1 + " " + x2);
				else
					System.out.println(x1 + " 0");
				continue;
			}

			long lo = 0;
			long hi = x2;

			long best = Long.MAX_VALUE;
			long y1 = -1;
			long y2 = -1;

			for (long i = 0; i <= x1; i++) {
				lo = i == 0 ? 1 : 0;
				hi = x2;
				while (lo < hi) {
					long m = (lo + hi) / 2;
					if (i * t1 + m * t2 < t0 * (i + m)) {
						lo = m + 1;
					} else {
						hi = m;
					}
				}
				long d = i * t1 + lo * t2 - t0 * (i + lo);
				if (d >= 0 && (d < best || (d == best && y1 + y2 < i + lo))) {
					best = d;
					y1 = i;
					y2 = lo;
				}
			}
			while (y2 < x2
					&& (y1 * t1 + (y2 + 1) * t2 - t0 * (y1 + y2 + 1) == best))
				y2++;
			if (y1 == 0) {
				y2 *= (x2 / y2);
			} else if (y2 == 0) {
				y1 *= (x1 / y1);
			} else {
				long k1 = x1 / y1;
				long k2 = x2 / y2;
				long k = Math.min(k1, k2);
				y1 *= k;
				y2 *= k;
			}
			System.out.println(y1 + " " + y2);
		}
	}

	public static void main(String[] args) throws IOException {
		new C().work();
	}

}

