class Fraction
{
	long num;
	long denom;

	public Fraction(long n, long d)
	{
		num = n;
		denom = d;
	}

	public long compareTo(Fraction f)
	{
		if(denom == f.denom)
		{
			return num - f.num;
		}
		else if(num == f.num && num != 0)
		{
			return f.denom - denom;
		}
		else
		{
			return num * f.denom - denom * f.num;
		}
	}
}

