		for (long y1 = x1; y1 > 0; --y1) {
			while (y2 > 0 && checkTemperature(t1, y1, t2, y2 - 1, t0) && compareTemperatures(t1, t2, y1, y2 - 1, y1, y2) < 0) {
				--y2;
			}

			if (checkTemperature(t1, y1, t2, y2, t0)) {
				int compareResult = compareTemperatures(t1, t2, y1, y2, bestY1, bestY2);
				if (compareResult < 0) {
					bestY1 = y1;
					bestY2 = y2;
				} else if (compareResult == 0 && y1 + y2 > bestY1 + bestY2) {
					bestY1 = y1;
					bestY2 = y2;
				}
			}
		}

		out.println(bestY1 + " " + bestY2);
	}

	private int compareTemperatures(
			long t1, long t2, 
			long a1, long a2,
			long b1, long b2) {
		long aT = (t1 * a1 + t2 * a2) * (b1 + b2);
		long bT = (t1 * b1 + t2 * b2) * (a1 + a2);

		if (aT < bT) return -1;
		if (aT > bT) return 1;

		return 0;
	}

	private boolean checkTemperature(long t1, long y1, long t2, long y2, long t0) {
		return t1 * y1 + t2 * y2 >= t0 * (y1 + y2);
	}
