template <typename T>
struct rational {
  T p, q;
  rational() { q = 1; };
  rational(T p, T q = 1) : p(p), q(q) { dr(); }
  void dr() {
    if (q < 0) p *= -1, q *= -1;
    T d = gcd((p < 0 ? p * (-1) : p), q);
    if (d != 0)
      p /= d, q /= d;
    else
      p = 0, q = 1;
  }
  rational(const rational& x) { p = x.p, q = x.q; }
  T gcd(T x, T y) {
    while (x > 0 and y > 0)
      if (x > y)
        x %= y;
      else
        y %= x;
    return x + y;
  }
  rational& operator+=(const rational& x) {
    p = p * x.q + q * x.p, q *= x.q;
    dr();
    return *this;
  }
  rational& operator-=(const rational& x) {
    p = p * x.q - q * x.p, q *= x.q;
    dr();
    return *this;
  }
  rational& operator*=(const rational& x) {
    p *= x.p, q *= x.q;
    dr();
    return *this;
  }
  rational& operator/=(const rational& x) {
    p *= x.q, q *= x.p;
    dr();
    return *this;
  }
  rational& operator-() {
    p = -p;
    return *this;
  }
  rational operator+(const rational& x) const { return rational(*this) += x; }
  rational operator-(const rational& x) const { return rational(*this) -= x; }
  rational operator*(const rational& x) const { return rational(*this) *= x; }
  rational operator/(const rational& x) const { return rational(*this) /= x; }
  bool operator<(const rational& x) const {
    return (long double)p * x.q < (long double)q * x.p;
  }
  bool operator<=(const rational& x) const { return !(x < *this); }
  bool operator>(const rational& x) const { return x < *this; }
  bool operator>=(const rational& x) const { return !(*this < x); }
  bool operator==(const rational& x) const {
    return !(*this < x) and !(x < *this);
  }
  bool operator!=(const rational& x) const {
    return (*this < x) or (x < *this);
  }
  double to_real() const { return p / (double)q; }
  T numerator() { return p; }
  T denominator() { return q; }
};
template <typename T>
ostream& operator<<(ostream& os, const rational<T>& x) {
  os << x.p << '/' << x.q;
  return os;
}
