    void check(int y1, int y2) {
        long num1 = (long) ans1 * t1 + (long) ans2 * t2;
        long num2 = (long) y1 * t1 + (long) y2 * t2;
        long denum1 = ans1 + ans2;
        long denum2 = y1 + y2;
        if (num1 * denum2 > num2 * denum1){
            ans1 = y1;
            ans2 = y2;
        } else{
            if (num1 * denum2 == num2 * denum1 && ans1 + ans2 < y1 + y2){
                ans1 = y1;
                ans2 = y2;                          
            }
        }
    }

    boolean correct(int y1, int y2){
        long z = (long) y1 * t1 + (long) y2 * t2;
        return (z >= (long)t0 * (y1 + y2));             
    }


    // ----------------------------------------
    void solve() throws NumberFormatException, IOException {
        t1 = readInt();
        t2 = readInt();
        int x1 = readInt();
        int x2 = readInt();
        t0 = readInt();

        ans1 = 0;
        ans2 = x2;

        for (int i=1;i<=x1;i++) {
            int l = i == 0 ? 1 : 0;
            int r = x2;
            if (correct(i, x2)){
                check(i,x2);
            }
            int ans = -1;
            while (l <= r) {
                int mid = (l + r) / 2;
                if (correct(i, mid)) {
                    ans = mid;
                    r = mid - 1;
                } else {
                    l = mid + 1;
                }
            }
            if (ans != -1){
                long num1 = (long) ans1 * t1 + (long) ans2 * t2;
                long num2 = (long) i * t1 + (long) ans * t2;
                long denum1 = ans1 + ans2;
                long denum2 = i + ans;
                if (num1 * denum2 > num2 * denum1){
                    ans1 = i;
                    ans2 = ans;
                } else{
                    if (num1 * denum2 == num2 * denum1 && ans1 + ans2 < ans + i){
                        ans1 = i;
                        ans2 = ans;                         
                    }
                }
            }
        }
        out.println(ans1+" "+ans2);
    }

