	private void go(long t1, long t2, long x1, long x2, long t0) {

		long bestn = -1;
		long bestd = -1;
		long sp = -1;
		long vvv = -1;
		long rrr = -1;

		if (t1 == t2 && t2 == t0) {
			System.out.printf(Locale.ENGLISH, "%d %d\n", x1, x2);
			return;
		} else if (t1 == t0) {
			System.out.printf(Locale.ENGLISH, "%d 0\n", x1);
			return;
		} else if (t2 == t0) {
			System.out.printf(Locale.ENGLISH, "0 %d\n", x2);
			return;
		} else if (t0 < Math.min(t1, t2)) {
			if (t1 < t2) {
				System.out.printf(Locale.ENGLISH, "%d 0\n", x1);
				return;
			} else {
				System.out.printf(Locale.ENGLISH, "0 %d\n", x2);
				return;
			}
		} else if (t0 > Math.max(t1, t2)) {
			if (t1 > t2) {
				System.out.printf(Locale.ENGLISH, "%d 0\n", x1);
				return;
			} else {
				System.out.printf(Locale.ENGLISH, "0 %d\n", x2);
				return;
			}
		}
		for (long v = 0; v <= x1; v++) {

			long rr = (long)Math.ceil((1.0 * t0 * v - t1 * v) / (t2 - t0));
			if (v + rr == 0 || rr > x2 || rr < 0) continue;
			long num = t1 * v + t2 * rr;
			long den = v + rr;
			if (num >= t0 * den) {
				if (bestn == -1 || num * bestd < bestn * den || (num * bestd == bestn * den && v + rr > sp)) {
					sp = v + rr;
					vvv = v;
					rrr = rr;
					bestn = num;
					bestd = den;
				}
			}
		}

		if (vvv == -1) {
			if (t1 > t2) {
				System.out.printf(Locale.ENGLISH, "%d 0\n", x1);
				return;
			} else {
				System.out.printf(Locale.ENGLISH, "0 %d\n", x2);
				return;
			}
		}

		System.out.printf(Locale.ENGLISH, "%d %d\n", vvv, rrr);
	}

	public static void main(String[] args) throws Exception {
		C a = new C();
		a.processInput();
	}
}

