public class Solution {
    static final double e = 1e-10;

    public static void main(String[] args) throws NumberFormatException, IOException {
        BufferedReader in = new BufferedReader(new InputStreamReader(System.in));
        PrintWriter out = new PrintWriter(System.out);

        StringTokenizer st = new StringTokenizer(in.readLine());

        long t1 = Long.parseLong(st.nextToken());
        long t2 = Long.parseLong(st.nextToken());
        long x1 = Long.parseLong(st.nextToken());
        long x2 = Long.parseLong(st.nextToken());
        long t0 = Long.parseLong(st.nextToken());

        Double min = Double.MAX_VALUE;
        long max = Long.MIN_VALUE;
        long y1_best = 0;
        long y2_best = 0;

        if (t1 == t0 && t2 == t0) {
            y1_best = x1;
            y2_best = x2;
        } else if (t1 == t0) {
            y1_best = x1;
            y2_best = 0;
        } else if (t2 == t0) {
            y1_best = 0;
            y2_best = x2;
        } else {
            for (long y1 = 0; y1 <= x1; y1++) {
                double y2_exact = 0;
                if (y1 > 0 && t2 != t0)
                    y2_exact = (double) ((t0 - t1) * y1) / (t2 - t0);
                else
                    y2_exact = x2;

                // System.err.prlong(y2_exact + " ");
                if (y2_exact - Math.floor(y2_exact) < e)
                    y2_exact = Math.floor(y2_exact);
                if (Math.ceil(y2_exact) - y2_exact < e)
                    y2_exact = Math.ceil(y2_exact);
                long y2 = (long) Math.ceil(y2_exact);
                y2 = y2 > x2 ? x2 : y2;

                double T = (double) (t1 * y1 + t2 * y2) / (y1 + y2);
                // System.err.prlong(T + " ");
                double diff = T - t0;

                if (diff < 0.)
                    continue;

                if (diff - min < -e || (Math.abs(diff - min) < e && y1 + y2 > max)) {
                    y1_best = y1;
                    y2_best = y2;
                    min = diff;
                    max = y1 + y2;
                    // System.err.prlong(y1 + " ");
                    // System.err.prlong(y2 + " ");
                    // System.err.prlongf("diff: %.15f\n", diff);
                }
            }
        }

        double T = (double) (t1 * y1_best + t2 * y2_best) / (y1_best + y2_best);
        // System.err.prlongln(T);
        out.print(y1_best + " " + y2_best);
        out.close();
    }
}

