        if(y1<0||y1>x1||y2<0||y2>x2){
            return;
        }
        F f1=new F(t1*y1+t2*y2, y1+y2);
        if(f1.compareTo(ft0)<0){
            return;
        }
        if(p.y1==0&&p.y2==0){
            p.y1=y1;
            p.y2=y2;
            return;
        }
        F f2=new F(t1*p.y1+t2*p.y2, p.y1+p.y2);
        if(f1.compareTo(f2)<0){
            p.y1=y1;
            p.y2=y2;
        }else if(f1.compareTo(f2)==0&&y1+y2>=p.y1+p.y2){
            p.y1=y1;
            p.y2=y2;
        }
    }

    class P{
        long y1, y2;

