            this.y1=y1;
            this.y2=y2;
        }
    }

    class F{
        long n, d;

        F(long n, long d){
            this.n=n;
            this.d=d;
            long gcd=gcd(Math.abs(n), d);
            this.n/=gcd;
            this.d/=gcd;
        }

        long gcd(long a, long b){
            return b!=0?gcd(b, a%b):a;
        }

        F add(F f){
            return new F(n*f.d+f.n*d, d*f.d);
        }

        F sub(F f){
            return new F(n*f.d-f.n*d, d*f.d);
        }

        int compareTo(F f){
            return (int)signum(sub(f).n);
        }
