public class A {
    static class Rational implements Comparable<Rational> {
        public static final Rational MAX_VALUE = new Rational(
                Integer.MAX_VALUE, 1);

        public final long numerator;
        public final long denominator;

        public Rational(long numerator, long denominator) {
            if (denominator == 0)
                throw new IllegalArgumentException();
            long gcd = IntegerUtils.gcd(Math.abs(numerator), Math
                    .abs(denominator));
            if (denominator > 0) {
                this.numerator = numerator / gcd;
                this.denominator = denominator / gcd;
            } else {
                this.numerator = -numerator / gcd;
                this.denominator = -denominator / gcd;
            }
        }

        public String toString() {
            return numerator + "/" + denominator;
        }

        public int compareTo(Rational other) {
            return IntegerUtils.longCompare(numerator * other.denominator,
                    denominator * other.numerator);
        }

        public boolean equals(Object o) {
            if (this == o)
                return true;
            if (o == null || getClass() != o.getClass())
                return false;

            Rational rational = (Rational) o;

            if (denominator != rational.denominator)
                return false;
            if (numerator != rational.numerator)
                return false;

            return true;
        }

        public int hashCode() {
            int result = (int) (numerator ^ (numerator >>> 32));
            result = 31 * result + (int) (denominator ^ (denominator >>> 32));
            return result;
        }

    }

    static class IntegerUtils {
        public static long gcd(long a, long b) {
            while (b != 0) {
                long temp = a % b;
                a = b;
                b = temp;
            }
            return a;
        }

        public static int longCompare(long a, long b) {
            if (a < b)
                return -1;
            if (a > b)
                return 1;
            return 0;
        }

    }

