            }
        }
        for (int i = 1; i <= x2; i++) {
            long tmp = (i*(t2-t0)) / (t0 - t1);
            double dtmp = (i*(t2-t0)) / ((t0 - t1) * 1.0);
            long pos1 = Math.min(tmp, x1), pos2;
            if (Math.abs(dtmp - tmp) != 0)
                pos2 = Math.min(tmp + 1, x1);
            else
                pos2 = pos1;
            Rational diff = new Rational(
                    (t1 * pos1 + t2 *i) - t0 * (i + pos1), (i + pos1));
            if (diff.compareTo(zero) >= 0) {
                if (diff.compareTo(minDiff) == 0) {
