            if (diff.compareTo(zero) >= 0) {
                if (diff.compareTo(minDiff) == 0) {
                    if (y1 + y2 < i + pos2) {
                        y1 = pos2;
                        y2 = i;
                    }
                } else if (diff.compareTo(minDiff) < 0) {
                    minDiff = diff;
                    y1 = pos2;
                    y2 = i;
                }
            }
        }
        System.out.println(y1 + " " + y2);
    }
}

