    /** http://pastebin.com/j0xdUjDn */
    static class Utils {

        private Utils() {}

        public static void mergeSort(int[] a) {
            mergeSort(a, 0, a.length - 1);
        }

        private static final int MAGIC_VALUE = 50;

        private static void mergeSort(int[] a, int leftIndex, int rightIndex) {
            if (leftIndex < rightIndex) {
                if (rightIndex - leftIndex <= MAGIC_VALUE) {
                    insertionSort(a, leftIndex, rightIndex);
                } else {
                    int middleIndex = (leftIndex + rightIndex) / 2;
                    mergeSort(a, leftIndex, middleIndex);
                    mergeSort(a, middleIndex + 1, rightIndex);
                    merge(a, leftIndex, middleIndex, rightIndex);
                }
            }
        }

        private static void merge(int[] a, int leftIndex, int middleIndex, int rightIndex) {
            int length1 = middleIndex - leftIndex + 1;
            int length2 = rightIndex - middleIndex;
            int[] leftArray = new int[length1];
            int[] rightArray = new int[length2];
            System.arraycopy(a, leftIndex, leftArray, 0, length1);
            System.arraycopy(a, middleIndex + 1, rightArray, 0, length2);
            for (int k = leftIndex, i = 0, j = 0; k <= rightIndex; k++) {
                if (i == length1) {
                    a[k] = rightArray[j++];
                } else if (j == length2) {
                    a[k] = leftArray[i++];
                } else {
                    a[k] = leftArray[i] <= rightArray[j] ? leftArray[i++] : rightArray[j++];
                }
            }
        }

        private static void insertionSort(int[] a, int leftIndex, int rightIndex) {
            for (int i = leftIndex + 1; i <= rightIndex; i++) {
                int current = a[i];
                int j = i - 1;
                while (j >= leftIndex && a[j] > current) {
                    a[j + 1] = a[j];
                    j--;
                }
                a[j + 1] = current;
            }
        }

    }

    // solution

    void solve() throws IOException {
        long t1 = readLong();
        long t2 = readLong();
        long x1 = readLong();
        long x2 = readLong();
        long t0 = readLong();
        if (t1 == t0 && t2 == t0) {
            out.println(x1 + " " + x2);
            return;
        }
        if (t1 == t0) {
            out.println(x1 + " " + 0);
            return;
        }
        if (t2 == t0) {
            out.println(0 + " " + x2);
            return;
        }
        long bestY1 = -1, bestY2 = -1;
        for (long y1 = x1; y1 >= 0; y1--) {
            double tmp = (y1 + 0.0) * (t0 - t1 + 0.0) / (t2 - t0 + 0.0);
            if (Double.isNaN(tmp) || Double.isInfinite(tmp)) {
                continue;
            }
            long tmp2 = round(tmp);
            for (long y2 = max(0, tmp2 - 10); y2 <= min(x2, tmp2 + 10); y2++) {
                if (t0 * (y1 + y2) <= (t1 * y1 + t2 * y2)) {
                    if (bestY1 == -1) {
                        bestY1 = y1;
                        bestY2 = y2;
                        continue;
                    }
                    long oldUp = fUp(t1, t2, bestY1, bestY2);
                    long oldDown = fDown(t1, t2, bestY1, bestY2);
                    long newUp = fUp(t1, t2, y1, y2);
                    long newDown = fDown(t1, t2, y1, y2);
                    if (newUp * oldDown < oldUp * newDown) {
                        bestY1 = y1;
                        bestY2 = y2;
                        continue;
                    }
                    if (newUp * oldDown == oldUp * newDown) {
                        if (y1 + y2 > bestY1 + bestY2) {
                            bestY1 = y1;
                            bestY2 = y2;
                            continue;
                        }
                    }
                }
            }
        }
        out.println(bestY1 + " " + bestY2);
    }

    long fUp(long t1, long t2, long y1, long y2) {
        return t1 * y1 + t2 * y2;
    }

    long fDown(long t1, long t2, long y1, long y2) {
        return y1 + y2;
    }

}

