    private static int search(int tHot, int yHot, int tCold, int xCold, int tNeed) {
        int low = 0, high = xCold;
        if (yHot == 0) ++low;
        while (low <= high) {
            int mid = (low + high) / 2;
            long t = (1L * tHot * yHot + 1L * tCold * mid) / (yHot + mid);
            if (t < tNeed) {
                high = mid - 1;
            } else {
                low = mid + 1;
            }
        }
        if (yHot > 0) return high;
        if (high == 0) return -1;
        return high;
    }

