import java.util.Scanner;

public class C {

	private C (Scanner sc) throws Throwable {
		int t1 = sc.nextInt();
		int t2 = sc.nextInt();
		int x1 = sc.nextInt();
		int x2 = sc.nextInt();
		int t0 = sc.nextInt();
		solve(t1, t2, x1, x2, t0);
	}

	private void solve (int t1, int t2, int x1, int x2, int t0) throws Throwable {
		int B1 = 0, B2 = 0; 
		double D = Integer.MAX_VALUE, S = 0;

		for (int y1 = 0; y1 <= x1; ++y1) {
			int p = 0, q = x2, m = (p+q)/2;
			while (q - p > 1) {
				if (test(t1,t2,y1,m,t0) < 0)
					p = m;
				else
					q = m;
				m = (p+q)/2;
			}
			double T = test(t1,t2,y1,0,t0); int s = y1+0;
			if (T >= 0) {
				if (T < D || (T == D && s > S)) {
					D = T; S = s; B1 = y1; B2 = 0;
				}
			}
			T = test(t1,t2,y1,p,t0); s = y1+p;
			if (T >= 0) {
				if (T < D || (T == D && s > S)) {
					D = T; S = s; B1 = y1; B2 = p;
				}
			}
			T = test(t1,t2,y1,q,t0); s = y1+q;
			if (T >= 0) {
				if (T < D || (T == D && s > S)) {
					D = T; S = s; B1 = y1; B2 = q;
				}
			}
			T = test(t1,t2,y1,x2,t0); s = y1+x2;
			if (T >= 0) {
				if (T < D || (T == D && s > S)) {
					D = T; S = s; B1 = y1; B2 = x2;
				}
			}
		}

		print(B1 + " " + B2);
	}

	double test (long t1, long t2, long y1, long y2, long t0) {
		return 1.0 * (t1*y1 + t2*y2) / (y1 + y2) - t0;
	}

	////////////////////////////////////////////////////////////////////////////////////

	private void print (Object o) {
		System.out.println(o);
	}

	public static void main(String[] args) throws Throwable {		
		Scanner sc = new Scanner(System.in);
		new C(sc);
	}	
}

