			System.out.println(0 + " " + x2);
		else {
			for (int y1 = 1; y1 <= x1; y1++) {
				y2 = f * y1;
				yy2 = (int) y2;
				solve(y1, yy2);
				yy2 = ((int) y2) - 1;
				solve(y1, yy2);
				yy2 = ((int) y2) + 1;
				solve(y1, yy2);
				yy2 = ((int) y2) - 2;
				solve(y1, yy2);
				yy2 = ((int) y2) + 2;
				solve(y1, yy2);
			}
