	public static void solve(int y1, int yy2) {
		double dit;
		if (yy2 <= x2 && y1 <= x1) {
			dit = getDif(y1, yy2);
			if (dit < dif && dit >= 0) {
				dif = dit;
				a1 = y1;
				a2 = yy2;
			} else if (Math.abs(dit - dif) <= 0.000000001 && y1 + yy2 > max
					&& dit >= 0) {
				max = y1 + yy2;
				a1 = y1;
				a2 = yy2;
			}
		}
	}

	public static double getDif(int y1, int y2) {
		double tt = ((double) y1 * (double) t1 + (double) y2 * (double) t2)
				/ ((double) y1 + (double) y2);
		return (double) tt - t;
	}
