class fraction{

    long x,y;
    public fraction(long x, long y) {

        long g = gcd(x,y);
        x /= g;
        y /= g;
        this.x = x;
        this.y = y;
    }
    long gcd(long a,long b){
        if(b>a) return gcd(b,a);
        if(b==0) return a;
        return gcd(b,a%b);
    }
    long compare(fraction f){
        BigInteger a1 = BigInteger.valueOf(x).multiply(BigInteger.valueOf(f.y));
        BigInteger a2 = BigInteger.valueOf(y).multiply(BigInteger.valueOf(f.x));
        BigInteger a = a1.subtract(a2);
        return a.compareTo(BigInteger.ZERO);
    }
}

