bool Check(long long y1, long long y2) {
  return t1 * y1 + t2 * y2 >= t * (y1 + y2);
}
double HotBath(long long y1, long long y2) {
  return 1.0 * (t1 * y1 + t2 * y2) / (y1 + y2);
}
int main() {
  cin >> t1 >> t2 >> x1 >> x2 >> t;
  long long Y1 = 0, Y2 = 0;
  if (HotBath(x1, x2) >= t) Y1 = x1, Y2 = x2;
  if (HotBath(x1, 0) >= t && x1 >= Y1 + Y2) Y1 = x1, Y2 = 0;
  if (HotBath(0, x2) >= t && x2 >= Y1 + Y2) Y1 = 0, Y2 = x2;
  for (long long y1 = 0; y1 <= x1; y1++) {
    long long y2 = 0;
    long long Start = 0, End = x2;
    while (Start <= End) {
      long long Mid = Start + End >> 1;
      if (Check(y1, Mid)) {
        y2 = Mid;
        End = Mid - 1;
      } else
        Start = Mid + 1;
    }
    if (y1 + y2 == 0) continue;
    double New = HotBath(y1, y2);
    double Old = HotBath(Y1, Y2);
    if (New >= 1.0 * t) {
      if (New < Old) {
        Old = New;
        Y1 = y1;
        Y2 = y2;
      } else if (fabs(New - Old) <= 1e-9 && (Y1 + Y2 < y1 + y2)) {
        Y1 = y1;
        Y2 = y2;
      }
    }
  }
