public class C {
	long t1, t2, t0, x1, x2, y1, y2;
	double opt = Integer.MAX_VALUE;
	double eps = 0.000000001;

	double solve(long i){
		return i*(t0-t1)/((t2-t0)*1.0);
	}

	boolean isValid(long i, long j){
		if(j>x2 || j<0) return false;

		double t = ((t1*i + t2*j)/((double)(i+j))) + eps;

		if(t+eps>=t0){
			if(Math.abs(t-opt) < eps){
				if(i+j > y1+y2) return true;
				else return false;
			} else if(t+eps < opt){
				opt=t;
				return true;
			}
			else return false;
		}
		return false;
	}

	void run()throws IOException{
		Scanner sc = new Scanner(new InputStreamReader(System.in));
		t1 = sc.nextInt();
		t2 = sc.nextInt();
		x1 = sc.nextInt();
		x2 = sc.nextInt();
		t0 = sc.nextInt();

		if(t1==t2){
			System.out.println(x1 + " " + x2);
			return;
		}
		if(isValid(0,x2)){
			y1 = 0;
			y2 = x2;
		}			

		if(isValid(x1,0)){
			y1 = x1;
			y2 = 0;
		}			

		long i=0, j=0;
		for(i=x1; i>=0; i--){
			j = (int) (Math.ceil(solve(i)) + eps);
			if(isValid(i,j)){
				y1 = i;
				y2 = j;
			}			
		}

		System.out.println(y1 + " " + y2);
	}

	public static void main(String[] args)throws IOException {
		new C().run();
	}
}

