using namespace std;
long long T1, T2, T0;
int X1, X2;
long long compare_fractions(long long n1, long long d1, long long n2,
                            long long d2) {
  return n1 * d2 - n2 * d1;
}
pair<int, int> find_temps(int a) {
  if (a == 0) return make_pair(0, X2);
  double b = (double)(T1 * a - T0 * a) / (T0 - T2);
  if (b < 0) b = 0;
  b = ceil(b);
  if (b > X2)
    return make_pair(-1, -1);
  else
    return make_pair(a, (int)b);
}
bool better(pair<int, int> a, pair<int, int> b) {
  if (a.first == -1) return false;
  if (b.first == -1) return true;
  long long y1 = a.first, y2 = a.second;
  long long z1 = b.first, z2 = b.second;
  long long c =
      compare_fractions(T1 * y1 + T2 * y2, y1 + y2, T1 * z1 + T2 * z2, z1 + z2);
  if (c != 0)
    return c < 0;
  else
    return (y1 + y2 > z1 + z2);
}
int main() {
  scanf("%I64d %I64d %d %d %I64d", &T1, &T2, &X1, &X2, &T0);
  if (T1 == T2) {
    printf("%d %d\n", X1, X2);
    return 0;
  } else if (T0 == T2) {
    printf("0 %d\n", X2);
    return 0;
  }
  pair<int, int> best = make_pair(-1, -1);
  for (int a = 0; a <= X1; a++) {
    pair<int, int> candidate = find_temps(a);
    if (better(candidate, best)) best = candidate;
  }
  printf("%d %d\n", best.first, best.second);
  return 0;
}

