class TaskC {
    public void solve(int testNumber, Reader in, PrintWriter out) {
        int t1, t2, x1, x2, t0;
        t1 = in.ni(); t2 = in.ni(); x1 = in.ni(); x2 = in.ni(); t0 = in.ni();
        int globalResY1, globalResY2;
        globalResY1 = globalResY2 = 0;
        double eps = Double.MAX_VALUE;
        int left, mid1, mid2, right;
        for(int y1 = 0; y1 <= x1; y1++) {
            int leftBorder = (y1 == 0 ? 1 : 0);
            left = leftBorder;
            right = x2;
            while(right - left > 3) {
                mid1 = left + (right - left) / 3;
                mid2 = right - (right - left) / 3;
                if(f(t1, t2, y1, mid1) <= f(t1, t2, y1, mid2)) {
                    left = mid1;
                } else {
                    right = mid2;
                }
            }
            int max = left;
            double value = 0;
            double temp;
            for(int i = Math.max(left - 2, leftBorder); i <= Math.min(right + 2, x2); i++) {
                temp = f(t1, t2, y1, i);
                if(value < temp) {
                    value = temp;
                    max = i;
                }
            }

            left = (y1 == 0 ? 1 : 0);
            right = max;
            while(left < right) {
                mid1 = left + (right - left) / 2;
                if(f(t1, t2, y1, mid1) <= t0) {
                    left = mid1 + 1;
                } else {
                    right = mid1;
                }
            }


            for(int i = Math.max(leftBorder, left - 2); i <= Math.min(right + 2, x2); i++) {
                temp = f(t1, t2, y1, i) - t0;
                if(temp < 0) {
                    continue;
                }
                if(eps >= temp) {
                    if(eps == temp) {
                        if(y1 + i > globalResY1 + globalResY2) {
                            globalResY1 = y1;
                            globalResY2 = i;
                        }
                    } else {
                        eps = temp;
                        globalResY1 = y1;
                        globalResY2 = i;
                    }
                }
            }

            left = max;
            right = x2;
            while(left < right) {
                mid1 = left + (right - left) / 2;
                if(f(t1, t2, y1, mid1) >= t0) {
                    left = mid1 + 1;
                } else {
                    right = mid1;
                }
            }
            for(int i = Math.max(leftBorder, left - 2); i <= Math.min(right + 2, x2); i++) {
                temp = f(t1, t2, y1, i) - t0;
                if(temp < 0) {
                    continue;
                }
                if(eps >= temp) {
                    if(eps == temp) {
                        if(y1 + i > globalResY1 + globalResY2) {
                            globalResY1 = y1;
                            globalResY2 = i;
                        }
                    } else {
                        eps = temp;
                        globalResY1 = y1;
                        globalResY2 = i;
                    }
                }
            }
        }
        out.println(globalResY1 + " " + globalResY2);
    }

    public double f(int t1, int t2, int y1, int y2) {
        return (1.0 * t1 * y1 + 1.0 * t2 * y2) / (y1 + y2);
    }
}

