    H = (t - Ct) * C / (Ht - t);
    if (((t - Ct) * C) % (Ht - t)) H++;
    if (H > Hmax) H = Hmax;
    tmp_t = (double)(Ct * C + Ht * H) / (double)(C + H);
    if (tmp_t < t) continue;
    if (tmp_t - t < ans_t) {
      ans_C = C;
      ans_H = H;
      ans_t = tmp_t - t;
    } else if (((tmp_t - t) < 0 ? (-(tmp_t - t)) : (tmp_t - t)) <= ans_t &&
               C + H > ans_C + ans_H) {
