long double eps = 1e-7;
struct Rational {
  long long a, b;
  Rational() {}
  Rational(long long a, long long b) : a(a), b(b) {}
  bool operator<(Rational o) const { return a * o.b < b * o.a; }
  bool operator<=(Rational o) const { return a * o.b <= b * o.a; }
  bool operator>(Rational o) const { return a * o.b > b * o.a; }
  bool operator==(Rational o) const { return a * o.b == b * o.a; }
  bool operator!=(Rational o) const { return a * o.b != b * o.a; }
};
struct TAns {
  Rational t;
  int ammount;
  TAns() {}
  TAns(Rational t, int ammount) : t(t), ammount(ammount) {}
  bool operator<(TAns o) const {
    if (t == o.t) {
      return ammount < o.ammount;
    }
    return t > o.t;
  }
};
void solve() {
  long long t1, t2, x1, x2, t0;
  cin >> t1 >> t2 >> x1 >> x2 >> t0;
  TAns ans = TAns(Rational(t2, 1), x2);
  int ans1 = 0;
  int ans2 = x2;
  for (int y1 = 0; y1 <= x1; ++y1) {
    int l = -1, r = x2 + 1;
    while (l + 1 < r) {
      int m = (l + r) / 2;
      if (y1 == 0 && m == 0) {
        r = m;
        continue;
      }
      if (Rational(y1 * t1 + m * t2, y1 + m) <= Rational(t0, 1)) {
        l = m;
      } else {
        r = m;
      }
    }
    int y2 = r;
    if (y2 != 0 && (y2 + y1 - 1 != 0) &&
        Rational(y1 * t1 + (y2 - 1) * t2, y1 + (y2 - 1)) == Rational(t0, 1)) {
      --y2;
    }
    if (y1 + y2 != 0 && y2 <= x2) {
      TAns tans = TAns(Rational((y1 * t1 + y2 * t2), (y1 + y2)), y1 + y2);
      if (ans < tans) {
        ans = tans;
        ans1 = y1;
        ans2 = y2;
      }
    }
  }
  cout << ans1 << " " << ans2 << endl;
}
int main() {
  ios_base::sync_with_stdio(false);
  solve();
  return 0;
}

