class TaskA {
    public void solve(int testNumber, InputReader in, PrintWriter out) {
        long t1 = in.readLong();
        long t2 = in.readLong();
        long x1 = in.readLong();
        long x2 = in.readLong();
        long t0 = in.readLong();

        if (t1 == t2) {
            out.println(x1 + " " + x2);
            return;
        } else if (t1 == t0) {
            out.println(x1 + " " + 0);
            return;
        } else if (t2 == t0) {
            out.println(0 + " " + x2);
            return;
        }

        long y1 = 0, y2 = 0;
        double min_diff = Double.MAX_VALUE;
        for (long b1 = 0; b1 <= x1; ++b1) {
            long low = 0, high = x2, b2;
            double diff;
            while (low <= high) {
                b2 = (low + high) >> 1;
                diff = f(b1, b2, t1, t2, t0);
                if (diff < 0.0) low = b2 + 1;
                else {
                    if (diff < min_diff) {
                        min_diff = diff;
                        y1 = b1;
                        y2 = b2;
                    } else if (diff == min_diff && b1 + b2 > y1 + y2) {
                        y1 = b1;
                        y2 = b2;
                    }
                    high = b2 - 1;
                }
            }
        }
        if (y1 == 0 && y2 != 0) y2 *= (x2 / y2);
        else if (y2 == 0 && y1 != 0) y1 *= (x1 / y1);
        out.println(y1 + " " + y2);
    }

    private double f(long y1, long y2, long t1, long t2, long t0) {
        if (y1 + y2 == 0) return -1.0;
        return 1.0 * (t1 * y1 + t2 * y2) / (y1 + y2) - t0;
    }
}

class InputReader {

    private InputStream stream;
    private byte[] buf = new byte[1024];
    private int curChar;
    private int numChars;

    public InputReader(InputStream stream) {
        this.stream = stream;
    }

    public int read() {
        if (numChars == -1)
            throw new InputMismatchException();
        if (curChar >= numChars) {
            curChar = 0;
            try {
                numChars = stream.read(buf);
            } catch (IOException e) {
                throw new InputMismatchException();
            }
            if (numChars <= 0)
                return -1;
        }
        return buf[curChar++];
    }

    public long readLong() {
        int c = read();
        while (isSpaceChar(c))
            c = read();
        int sgn = 1;
        if (c == '-') {
            sgn = -1;
            c = read();
        }
        long res = 0;
        do {
            if (c < '0' || c > '9')
                throw new InputMismatchException();
            res *= 10;
            res += c - '0';
            c = read();
        } while (!isSpaceChar(c));
        return res * sgn;
    }

    private boolean isSpaceChar(int c) {
        return c == ' ' || c == '\n' || c == '\r' || c == '\t' || c == -1;
    }

    }

