long int mini(long int a, long int b) {
  if (a < b)
    return a;
  else
    return b;
}
long int nod(long int a, long int b) {
  while ((a != 0) && (b != 0)) {
    if (a > b)
      a %= b;
    else
      b %= a;
  }
  if (a == 0 && b == 0)
    return (1);
  else
    return (a + b - mini(a, b));
}
