public class C_D1 {

	final static double ep = 1e-10;

	long t1, t2, x1, x2, t0;

	public void solve() throws IOException {

		t1 = nextLong();
		t2 = nextLong();
		x1 = nextLong();
		x2 = nextLong();
		t0 = nextLong();

		double bestPro = 1000000000;
		long bestSum = -1;
		long bestY1 = -1;
		long bestY2 = -1;

		for (long y1 = 0; y1 <= x1; y1++) {
			double val = find1(y1);
			if (val == -1) continue;
			long y2 = find2(y1, val);
			double can = (double)(t1 * y1 + t2 * y2) / (y1 + y2);
			//System.out.println(can + " " + val + " " + y1 + " " + y2);
			if (can - t0 - bestPro + t0 - ep < 0)  {
				bestPro = can;
				bestSum = y1 + y2;
				bestY1 = y1;
				bestY2 = y2;
			}
			else
				if (Math.abs(can - t0 - bestPro + t0) < ep && y1 + y2 > bestSum) {
					bestSum = y1 + y2;
					bestY1 = y1;
					bestY2 = y2;
				}
		}
		writer.println(bestY1 + " " + bestY2);
	}

	final private double find1(long y1) {
		if (t1 >= t0) return t1;
		if (t1 * y1 + t2 * x2 < t0 * (y1 + x2)) return -1;
		long l = 0, r = x2;
		while (l + 1 < r) {
			long y2 = (l + r) >> 1; 
			if (t1 * y1 + t2 * y2 >= t0 * (y1 + y2))
				r = y2;
			else
				l = y2;
		}
		return (double)(t1 * y1 + t2 * r) / (y1 + r);
	}

	final private long find2(long y1, double value) {
		long l = 0, r = x2 + 1;
		while (l + 1 < r) {
			long y2 = (l + r) >> 1;
			if ((double)(t1 * y1 + t2 * y2) / (y1 + y2) - value - ep <= 0) 
				l = y2;
			else
				r = y2;
		}
		return l;
	}

