            out.println(y1 + " " + y2);
            return;
        }

        y1 = 0;
        y2 = 0;
        double min_diff = 1e10;
        for (long b1 = 0; b1 <= x1; ++b1) {
            long low = 0, high = x2, b2;
            double diff = 1e10;
            while (low <= high) {
                b2 = (low + high) / 2;
                if (!(b1 == 0 && b2 == 0)) {
                    diff = f(b1, b2, t0, t1, t2);
                    if (diff < 0) {
                        low = b2 + 1;
                        continue;
                    }
                    if (Math.abs(diff) == min_diff) {
                        if (b1 + b2 > y1 + y2) {
                            y1 = b1;
                            y2 = b2;
                        }
                    } else if (Math.abs(diff) < min_diff) {
                        min_diff = Math.abs(diff);
                        y1 = b1;
                        y2 = b2;
                    }
                }
                if (diff == 0) {
                    b1 = x1 + 1;
                    break;
                } else
                    high = b2 - 1;
            }
        }

        if (y1 == 0) {
            out.println("0 " + x2);
            return;
        } else if (y2 == 0) {
            out.println(x1 + " 0");
            return;
        }

        long b = Math.min(x1 / y1, x2 / y2);
        y1 *= b;
        y2 *= b;
        out.println(y1 + " " + y2);
    }

    private double f(long y1, long y2, long t0, long t1, long t2) {
        return (1.0 * t1 * y1 + t2 * y2) / (y1 + y2) - t0;
    }

    private long gcd(long a, long b) {
        long r;
        while (b > 0) {
            r = a % b;
            a = b;
            b = r;
        }
        return a;
    }
